    "diabetes_bl", "cardio_bl", "smoke_bl", "age_t1", "age_t2", "age_t3", "age_t4",
    "age_t5", "age_t6", "animals_t1", "animals_t2", "animals_t3", "animals_t4",
    "animals_t5", "animals_t6", "fev_t1", "fev_t2", "fev_t3", "fev_t4", "fev_t5",
    "fev_t6", "fvc_t1", "fvc_t2", "fvc_t3", "fvc_t4", "fvc_t5", "fvc_t6", "gait_t1",
    "gait_t2", "gait_t3", "gait_t4", "gait_t5", "gait_t6", "grip_t1", "grip_t2",
    "grip_t3", "grip_t4", "grip_t5", "grip_t6", "pef_t1", "pef_t2", "pef_t3",
    "pef_t4", "pef_t5", "pef_t6", "word_recall_de_t1", "word_recall_de_t2",
    "word_recall_de_t3", "word_recall_de_t4", "word_recall_de_t5",
    "word_recall_de_t6", "word_recall_im_t1", "word_recall_im_t2",
    "word_recall_im_t3", "word_recall_im_t4", "word_recall_im_t5",
    "word_recall_im_t6", "year_t1", "year_t2", "year_t3", "year_t4", "year_t5",
    "year_t6", "years_since_bl_t1", "years_since_bl_t2", "years_since_bl_t3",
    "years_since_bl_t4", "years_since_bl_t5", "years_since_bl_t6" )
	;
Missing are all (-9999);
USEVAR are
	!define the variables used in the analysis
	! covariates used in the model
age_bl edu_bl	
	!estimated time points
time1
time2
time3
time4
time5
	!modelled time points of process (A)
a1
a2
a3
a4
a5 
	!modelled time points of process (B)
b1
b2
b3
b4
b5 
;
TSCORES are
	!estimated time points
time1
time2
time3
time4
time5;
USEOBSERVATIONS are
	!select a subset of observations
male_bl EQ 1
!and
!dementia_ever NE 1
;
DEFINE:
	! assign variables to the process (A)
a1=gait_t1;
a2=gait_t2;
a3=gait_t3;
a4=gait_t4;
a5=gait_t5;
	! assign variables to the process (B)
b1=animals_t1;
b2=animals_t2;
b3=animals_t3;
b4=animals_t4;
b5=animals_t5;
	!assign variables to time points
time1=years_since_bl_t1;
time2=years_since_bl_t2;
time3=years_since_bl_t3;
time4=years_since_bl_t4;
time5=years_since_bl_t5;

ANALYSIS:
TYPE = RANDOM;
COVERAGE=.00;  
MODEL:
	!first-level equation
	! assign process (A) to time points 
ia sa | a1 AT time1 ;
ia sa | a2 AT time2 ;
ia sa | a3 AT time3 ;
ia sa | a4 AT time4 ;
ia sa | a5 AT time5 ;
	! assign process (B) to time points 
ib sb | b1 AT time1 ;
ib sb | b2 AT time2 ;
ib sb | b3 AT time3 ;
ib sb | b4 AT time4 ;
ib sb | b5 AT time5 ;
	!variance of the first-level terms
ia (v_ia);
sa (v_sa);
ib (v_ib);
sb (v_sb);
	!covariance among first-level terms
ia WITH sa (c_iasb);
ia WITH ib (c_iaib);
ia WITH sb (c_iasb);
sa WITH ib (c_saib);
sa WITH sb (c_sasb);
ib WITH sb (c_iasb);
	!second-level equation
ia sa ib sb ON age_bl edu_bl;
	!residual covariance of process (A)
a1 (res_a);
a2 (res_a);
a3 (res_a);
a4 (res_a);
a5 (res_a);	
	!residual covariance of process (B)
b1 (res_b);
b2 (res_b);
b3 (res_b);
b4 (res_b);
b5 (res_b);	
	!Paired covariances constrained to be equal across t
a1 pwith b1 (res_cov);
a2 pwith b2 (res_cov);
a3 pwith b3 (res_cov);
a4 pwith b4 (res_cov);
a5 pwith b5 (res_cov);	
MODEL CONSTRAINT:
	!assigns labels to new parameters;
NEW r_iaib;
NEW r_sasb;
NEW r_res_ab;
	!compute confidence intervals for correlation coefficients; 
r_iaib = c_iaib/((v_ia**0.5)*(v_ib**0.5));
r_sasb = c_sasb/((v_sa**0.5)*(v_sb**0.5));
r_res_ab = res_cov/((res_a**0.5)*(res_b**0.5));
OUTPUT: sampstat cinterval;
PLOT: Type is Plot1 Plot2 Plot3;

