	! assign process (A) to time points 
ia sa | a1 AT time1 ;
ia sa | a2 AT time2 ;
ia sa | a3 AT time3 ;
ia sa | a4 AT time4 ;
ia sa | a5 AT time5 ;
	! assign process (B) to time points 
ib sb | b1 AT time1 ;
ib sb | b2 AT time2 ;
ib sb | b3 AT time3 ;
ib sb | b4 AT time4 ;
ib sb | b5 AT time5 ;
	!variance of the first-level terms
ia (v_ia);
sa (v_sa);
ib (v_ib);
sb (v_sb);
	!covariance among first-level terms
ia WITH sa (c_iasb);
ia WITH ib (c_iaib);
ia WITH sb (c_iasb);
sa WITH ib (c_saib);
sa WITH sb (c_sasb);
ib WITH sb (c_iasb);
	!second-level equation
