a1 pwith b1 (res_cov);
a2 pwith b2 (res_cov);
a3 pwith b3 (res_cov);
a4 pwith b4 (res_cov);
a5 pwith b5 (res_cov);	
MODEL CONSTRAINT:
	!assigns labels to new parameters;
NEW r_iaib;
NEW r_sasb;
NEW r_res_ab;
