    "animals_t5", "animals_t6", "fev_t1", "fev_t2", "fev_t3", "fev_t4", "fev_t5",
    "fev_t6", "fvc_t1", "fvc_t2", "fvc_t3", "fvc_t4", "fvc_t5", "fvc_t6", "gait_t1",
    "gait_t2", "gait_t3", "gait_t4", "gait_t5", "gait_t6", "grip_t1", "grip_t2",
    "grip_t3", "grip_t4", "grip_t5", "grip_t6", "pef_t1", "pef_t2", "pef_t3",
    "pef_t4", "pef_t5", "pef_t6", "word_recall_de_t1", "word_recall_de_t2",
    "word_recall_de_t3", "word_recall_de_t4", "word_recall_de_t5",
    "word_recall_de_t6", "word_recall_im_t1", "word_recall_im_t2",
