time1
time2
time3
time4
time5
time6;
USEOBSERVATIONS are
	!select a subset of observations
male_bl EQ 1
!and
!dementia_ever NE 1
;
DEFINE:
	! assign variables to the process (A)
a1=gait_t1;
a2=gait_t2;
a3=gait_t3;
a4=gait_t4;
a5=gait_t5;
a6=gait_t6;
	! assign variables to the process (B)
b1=word_recall_im_t1;
b2=word_recall_im_t2;
b3=word_recall_im_t3;
b4=word_recall_im_t4;
b5=word_recall_im_t5;
b6=word_recall_im_t6;
	!assign variables to time points
time1=years_since_bl_t1;
time2=years_since_bl_t2;
time3=years_since_bl_t3;
time4=years_since_bl_t4;
time5=years_since_bl_t5;
time6=years_since_bl_t6;

ANALYSIS:
TYPE = RANDOM;
COVERAGE=.00;  
MODEL:
	!first-level equation
	! assign process (A) to time points 
ia sa | a1 AT time1 ;
ia sa | a2 AT time2 ;
ia sa | a3 AT time3 ;
ia sa | a4 AT time4 ;
ia sa | a5 AT time5 ;
ia sa | a6 AT time6 ;
	! assign process (B) to time points 
ib sb | b1 AT time1 ;
ib sb | b2 AT time2 ;
ib sb | b3 AT time3 ;
ib sb | b4 AT time4 ;
ib sb | b5 AT time5 ;
ib sb | b6 AT time6 ;
	!variance of the first-level terms
ia (v_ia);
sa (v_sa);
ib (v_ib);
sb (v_sb);
	!covariance among first-level terms
ia WITH sa (c_iasb);
ia WITH ib (c_iaib);
ia WITH sb (c_iasb);
sa WITH ib (c_saib);
sa WITH sb (c_sasb);
ib WITH sb (c_iasb);
	!second-level equation
ia sa ib sb ON ade_bl;
	!residual covariance of process (A)
a1 (res_a);
a2 (res_a);
a3 (res_a);
a4 (res_a);
a5 (res_a);
a6 (res_a);	
	!residual covariance of process (B)
b1 (res_b);
b2 (res_b);
b3 (res_b);
b4 (res_b);
b5 (res_b);
b6 (res_b);	
	!Paired covariances constrained to be equal across t
a1 pwith b1 (res_cov);
a2 pwith b2 (res_cov);
a3 pwith b3 (res_cov);
a4 pwith b4 (res_cov);
a5 pwith b5 (res_cov);
a6 pwith b6 (res_cov);	
MODEL CONSTRAINT:
	!assigns labels to new parameters;
NEW r_iaib;
NEW r_sasb;
NEW r_res_ab;
