r_iaib = c_iaib/((v_ia**0.5)*(v_ib**0.5));
r_sasb = c_sasb/((v_sa**0.5)*(v_sb**0.5));
r_res_ab = res_cov/((res_a**0.5)*(res_b**0.5));
OUTPUT: sampstat cinterval;
